def gev_p12_mu1fa(alpha, t01, t02, v1, v2, v3, v4, v5):
    """
    Minus the first derivative of the cdf, at alpha
    Returns Vector
    """
    x = genextreme.ppf(1-alpha, c=-v5, loc=v1+v2*t01, scale=np.exp(v3+v4*t02))
    v3 = cp_utils.movexiawayfromzero(v3)
    mu1 = -gev_p12_pd(x, t01, t02, v1, v2, v3, v4, v5)
    return mu1

def gev_p12_mu2fa(alpha, t01, t02, v1, v2, v3, v4, v5):
    """
    Minus the second derivative of the cdf, at alpha
    Returns Matrix
    """
    x = genextreme.ppf(1-alpha, c=-v5, loc=v1+v2*t01, scale=np.exp(v3+v4*t02))
    nx = len(x)
    v3 = cp_utils.movexiawayfromzero(v3)
    mu2 = -gev_p12_pdd(x, t01, t02, v1, v2, v3, v4, v5)
    return mu2

def gev_p12_ldda(x, t1, t2, v1, v2, v3, v4, v5):
    """
    The second derivative of the normalized log-likelihood
    Returns Matrix
    """
    nx = len(x)
    v3 = cp_utils.movexiawayfromzero(v3)
    temp1 = gev_p12_logfdd(x, t1, t2, v1, v2, v3, v4, v5)
    ldd = np.sum(temp1, axis=-1) / nx
    return ldd

def gev_p12_lddda(x, t1, t2, v1, v2, v3, v4, v5):
    """
    The third derivative of the normalized log-likelihood
    Returns 3d array
    """
    nx = len(x)
    v3 = cp_utils.movexiawayfromzero(v3)
    temp1 = gev_p12_logfddd(x, t1, t2, v1, v2, v3, v4, v5)
    lddd = lddd = np.sum(temp1, axis=-1) / nx
    return lddd
